Автопортрет психики:
1. темперамент- флегматик;
2. характер- самокритичный, скромный, замкнутый
3. способности- адаптивные;
4. направленность- склонность к не мотивированному преодаление рутинной безопасности существования;
5. интеллектуальность- рациональная аккомодация направленная на тупость (ну и на употребление в лексиконе "новых" не знакомых терминов) ;
6. эмоциональность- повышенная эмоциональность и устойчивая дипрессия на фоне вялого темперамента и стресса;
7. волевые качества- свои и сложные, есть плюсы и минусы;
8. умение общаться- отсутствует помимо межличностного доверительного общения;
9. самооценка- заниженная(так что автопортрет может быть неудачен);
10. уровень самоконтроля- предельный;
11. способность к групповому взаимодействию- нету, из за доли эгоизма склонен верить что общество не приносит пользы, и чаще всего приходиться решать "проблемы" самому!
12. а так я просто ШИЗИК!
